import React from 'react';
import './App.css';

function App() {
  return (
    <div id="Componente_Padre">
    	<h1>Soy el componente padre</h1>

    	<div id="Componente_Hijo">
    		<h2>Soy el componente hijo</h2>
    	</div>
    </div>
  );
}

export default App;
